const Spec = (properties) => {
    return(
        <tr>
          <td>{properties.header}</td>
          {preparePoints(properties.text)}
        </tr>
    )
}
const preparePoints = (properties) =>{
const points = properties.map((item, pos) => {
  return(
    <td><p>{properties[pos]}</p></td>
  )
})
return points;
}

export default Spec;
